import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { AdminHomeComponent } from './admin-home.component';

const routes: Routes = [
  {
    path: '',
    component: AdminHomeComponent,
    children: [
      {
        path: 'alunos',
        loadComponent: () =>
          import('./pages/alunos/alunos.component').then(m => m.AlunosComponent)
      },
      {
        path: 'professores',
        loadComponent: () =>
          import('./pages/professores/professores.component').then(m => m.ProfessoresComponent)
      },
      {
        path: 'cursos',
        loadComponent: () =>
          import('./pages/cursos/cursos.component').then(m => m.CursosComponent)
      },
      {
        path: 'matriculas',
        loadComponent: () =>
          import('./pages/matriculas/matriculas.component').then(m => m.MatriculasComponent)
      },
      {
        path: 'usuarios',
        loadComponent: () =>
          import('./pages/usuarios/usuarios.component').then(m => m.UsuariosComponent)
      },
      {
        path: '',
        redirectTo: 'alunos',
        pathMatch: 'full'
      }
    ]
  }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class AdminRoutingModule {}
